import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
import "./Netflix-assets/css/index.css";
import MyNavbar from "./components/MyNavbar";
import MyFooter from "./components/myFooter";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import TvShows from "./components/TvShows";
import MyGallery from "./components/MyGallery";
import MyProfile from "./components/MyProfile";
import Settings from "./components/Settings";

function App() {
  return (
    <div className="App bg-dark">
      <main id="card" className=" text-white mt-4 bg-dark">
        {" "}
        <section id="card">
          {" "}
          <BrowserRouter>
            <Routes>
              <Route path="/" element={<TvShows />} />
              <Route path="/" element={<MyGallery nameMovies={"superman"} />} />
            </Routes>
          </BrowserRouter>
        </section>
      </main>

      <MyNavbar />

      {/*  <main id="card" className=" text-white mt-4 bg-dark">
        <section id="card">
          <TvShows />
          <MyGallery nameMovies={"batman"} />
          <MyGallery nameMovies={"spiderman"} />
          <MyGallery nameMovies={"superman"} />
        </section>
  </main>*/}

      <MyFooter />
    </div>
  );
}

export default App;
